message:
/* Sports */This change reflects the overarching broad editor consensus in the talk pages regarding the spirit of image improvement.

First step of [[WP:BRD]] cycle. Let’s see if it sticks.

(If you oppose on technical grounds – caption, image size, format, etc – please keep the image in place and improve the technical issue at hand instead of reverting the whole image.)

/* Mass media */I have started the talk page discussion, also with request for wider comment.

As it stands now with the current content of the section, the image is clearly not neutral. There is nothing in the body text or caption that indicates why NBC has superior impact, notability, or prominence among the other TV networks. They are all presently depicted on equal footing.

This either needs a neutral balanced representation of all the big players in TV (montage is one way), or the text...
